import React from "react";
import Navbar from "./navbar";
import Footer from "./footer";
import Pricing from "./pricing";
import ChoseUs from "./choseUs";
import Team from "./team";

function Home() {
  return (
    <>
      <Navbar />
      <ChoseUs />
      <Pricing />
      <Team />
      <br />
      <br />
      <br />
      <br />
      <Footer />
    </>
  );
}

export default Home;
